export const LoginScreen = ({history}) => {

    const handleLogin = () => {
        history.push('/');
    }

    return (
        <div className="container mt-5">
            <h1>LoginScreen</h1>
            <hr/>
            <button className="btn btn-primary" onClick={handleLogin}>
                login
            </button>
        </div>
    )
}
